                Kmac256.HashData(key, source, outputLength, customizationString);

            public static byte[] HashData(ReadOnlySpan<byte> key, ReadOnlySpan<byte> source, int outputLength, ReadOnlySpan<byte> customizationString) =>
                Kmac256.HashData(key, source, outputLength, customizationString);

